<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Speedwatch Data Analysis Dashboard</title>
    <script src="https://unpkg.com/react@18/umd/react.production.min.js"></script>
    <script src="https://unpkg.com/react-dom@18/umd/react-dom.production.min.js"></script>
    <script src="https://unpkg.com/@babel/standalone/babel.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/chart.js@4.4.0/dist/chart.umd.min.js"></script>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            padding: 20px;
        }
        .container {
            max-width: 1400px;
            margin: 0 auto;
            background: white;
            border-radius: 20px;
            box-shadow: 0 20px 60px rgba(0,0,0,0.3);
            overflow: hidden;
        }
        .header {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            padding: 30px;
            text-align: center;
        }
        .header h1 {
            font-size: 2.5rem;
            margin-bottom: 10px;
        }
        .header p {
            font-size: 1.1rem;
            opacity: 0.9;
        }
        .content {
            padding: 30px;
        }
        .stats-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
            gap: 20px;
            margin-bottom: 30px;
        }
        .stat-card {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            padding: 25px;
            border-radius: 15px;
            box-shadow: 0 5px 15px rgba(0,0,0,0.1);
        }
        .stat-value {
            font-size: 2.5rem;
            font-weight: bold;
            margin: 10px 0;
        }
        .stat-label {
            font-size: 0.9rem;
            opacity: 0.9;
        }
        .filters {
            background: #f8f9ff;
            padding: 25px;
            border-radius: 15px;
            margin-bottom: 30px;
        }
        .filter-row {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 15px;
            margin-bottom: 15px;
        }
        .filter-group {
            display: flex;
            flex-direction: column;
        }
        .filter-group label {
            font-weight: 600;
            margin-bottom: 8px;
            color: #333;
        }
        .filter-group select,
        .filter-group input {
            padding: 10px;
            border: 2px solid #e0e0e0;
            border-radius: 8px;
            font-size: 1rem;
        }
        .chart-section {
            background: white;
            padding: 25px;
            border-radius: 15px;
            box-shadow: 0 5px 15px rgba(0,0,0,0.1);
            margin-bottom: 30px;
        }
        .chart-section h2 {
            color: #333;
            margin-bottom: 20px;
            font-size: 1.5rem;
        }
        .chart-container {
            position: relative;
            height: 400px;
        }
        .tabs {
            display: flex;
            gap: 10px;
            margin-bottom: 20px;
            flex-wrap: wrap;
        }
        .tab {
            padding: 12px 24px;
            border: none;
            background: #e0e0e0;
            border-radius: 8px;
            cursor: pointer;
            font-size: 1rem;
            transition: all 0.3s;
        }
        .tab.active {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
        }
        .data-table {
            overflow-x: auto;
            margin-top: 20px;
        }
        table {
            width: 100%;
            border-collapse: collapse;
        }
        th, td {
            padding: 12px;
            text-align: left;
            border-bottom: 1px solid #e0e0e0;
        }
        th {
            background: #f8f9ff;
            font-weight: 600;
            color: #333;
        }
        tr:hover {
            background: #f8f9ff;
        }
        .loading {
            text-align: center;
            padding: 40px;
            font-size: 1.2rem;
            color: #667eea;
        }
        .export-button {
            background: #28a745;
            color: white;
            padding: 10px 20px;
            border: none;
            border-radius: 8px;
            cursor: pointer;
            margin-right: 10px;
            transition: transform 0.2s;
        }
        .export-button:hover {
            transform: scale(1.05);
        }
    </style>
</head>

    <script type="text/babel">
        const { useState, useEffect, useRef } = React;

        function SpeedwatchDashboard() {
            const [data, setData] = useState(null);
            const [filteredData, setFilteredData] = useState(null);
            const [activeTab, setActiveTab] = useState('overview');
            const [loading, setLoading] = useState(true);
            const [filters, setFilters] = useState({
                dateFrom: '',
                dateTo: '',
                dayOfWeek: 'all',
                timeOfDay: 'all',
                speedLimit: 30
            });

            const chartRefs = {
                hourly: useRef(null),
                daily: useRef(null),
                speed: useRef(null),
                compliance: useRef(null)
            };

            const charts = useRef({});

            // Load embedded data on mount
            useEffect(() => {
                try {
                    processData(SPEEDWATCH_DATA);
                    setLoading(false);
                } catch (err) {
                    console.error('Error processing data:', err);
                    setLoading(false);
                }
            }, []);

            const processData = (rawData) => {
                const headers = rawData[0];
                const rows = rawData.slice(1).filter(row => row[0]);
                
                const processed = rows.map(row => {
                    // Parse UK date format DD/MM/YYYY HH:MM:SS
                    const [datePart, timePart] = row[0].split(' ');
                    const [day, month, year] = datePart.split('/');
                    const dateStr = `${year}-${month}-${day}T${timePart}`;
                    const timestamp = new Date(dateStr);
                    
                    const speeds = {};
                    let totalVehicles = 0;
                    
                    headers.slice(1).forEach((header, idx) => {
                        const count = parseInt(row[idx + 1]) || 0;
                        speeds[header] = count;
                        totalVehicles += count;
                    });
                    
                    return {
                        timestamp,
                        date: timestamp.toLocaleDateString(),
                        time: timestamp.toLocaleTimeString(),
                        hour: timestamp.getHours(),
                        dayOfWeek: timestamp.toLocaleDateString('en-US', { weekday: 'long' }),
                        speeds,
                        totalVehicles
                    };
                });

                setData(processed);
                setFilteredData(processed);
                
                // Set date range
                if (processed.length > 0) {
                    setFilters(prev => ({
                        ...prev,
                        dateFrom: processed[0].timestamp.toISOString().split('T')[0],
                        dateTo: processed[processed.length - 1].timestamp.toISOString().split('T')[0]
                    }));
                }
            };

            useEffect(() => {
                if (data) {
                    applyFilters();
                }
            }, [filters, data]);

            const applyFilters = () => {
                if (!data) return;

                let filtered = data.filter(row => {
                    const rowDate = row.timestamp.toISOString().split('T')[0];
                    
                    if (filters.dateFrom && rowDate < filters.dateFrom) return false;
                    if (filters.dateTo && rowDate > filters.dateTo) return false;
                    if (filters.dayOfWeek !== 'all' && row.dayOfWeek !== filters.dayOfWeek) return false;
                    
                    if (filters.timeOfDay !== 'all') {
                        const hour = row.hour;
                        if (filters.timeOfDay === 'morning' && (hour < 6 || hour >= 12)) return false;
                        if (filters.timeOfDay === 'afternoon' && (hour < 12 || hour >= 18)) return false;
                        if (filters.timeOfDay === 'evening' && (hour < 18 || hour >= 24)) return false;
                        if (filters.timeOfDay === 'night' && (hour >= 6)) return false;
                    }
                    
                    return true;
                });

                setFilteredData(filtered);
            };

            useEffect(() => {
                if (filteredData && activeTab !== 'data') {
                    setTimeout(() => updateCharts(), 100);
                }
            }, [filteredData, activeTab]);

            const calculateStats = () => {
                if (!filteredData) return null;

                const totalVehicles = filteredData.reduce((sum, row) => sum + row.totalVehicles, 0);
                const speedLimit = filters.speedLimit;
                
                let compliant = 0;
                let speeding = 0;
                let maxSpeed = 0;

                filteredData.forEach(row => {
                    Object.entries(row.speeds).forEach(([speedBand, count]) => {
                        const match = speedBand.match(/Speed (\d+) to (\d+)/);
                        if (match) {
                            const midSpeed = (parseInt(match[1]) + parseInt(match[2])) / 2;
                            if (midSpeed > maxSpeed && count > 0) maxSpeed = midSpeed;
                            
                            if (midSpeed <= speedLimit) {
                                compliant += count;
                            } else {
                                speeding += count;
                            }
                        }
                    });
                });

                return {
                    totalVehicles,
                    compliant,
                    speeding,
                    complianceRate: ((compliant / totalVehicles) * 100).toFixed(1),
                    maxSpeed: Math.round(maxSpeed),
                    avgVehiclesPerHour: (totalVehicles / (filteredData.length / 12)).toFixed(0),
                    dateRange: filteredData.length > 0 ? 
                        `${filteredData[0].date} - ${filteredData[filteredData.length - 1].date}` : 'N/A'
                };
            };

            const updateCharts = () => {
                if (!filteredData) return;

                // Destroy existing charts
                Object.values(charts.current).forEach(chart => {
                    if (chart) chart.destroy();
                });

                // Hourly distribution
                if (chartRefs.hourly.current) {
                    const hourlyData = Array(24).fill(0);
                    filteredData.forEach(row => {
                        hourlyData[row.hour] += row.totalVehicles;
                    });

                    charts.current.hourly = new Chart(chartRefs.hourly.current, {
                        type: 'bar',
                        data: {
                            labels: Array.from({length: 24}, (_, i) => `${i}:00`),
                            datasets: [{
                                label: 'Vehicles per Hour',
                                data: hourlyData,
                                backgroundColor: 'rgba(102, 126, 234, 0.8)',
                                borderColor: 'rgba(102, 126, 234, 1)',
                                borderWidth: 2
                            }]
                        },
                        options: {
                            responsive: true,
                            maintainAspectRatio: false,
                            plugins: {
                                legend: { display: true }
                            },
                            scales: {
                                y: { beginAtZero: true }
                            }
                        }
                    });
                }

                // Daily distribution
                if (chartRefs.daily.current) {
                    const dailyData = {};
                    filteredData.forEach(row => {
                        dailyData[row.date] = (dailyData[row.date] || 0) + row.totalVehicles;
                    });

                    charts.current.daily = new Chart(chartRefs.daily.current, {
                        type: 'line',
                        data: {
                            labels: Object.keys(dailyData),
                            datasets: [{
                                label: 'Vehicles per Day',
                                data: Object.values(dailyData),
                                borderColor: 'rgba(118, 75, 162, 1)',
                                backgroundColor: 'rgba(118, 75, 162, 0.2)',
                                borderWidth: 3,
                                fill: true,
                                tension: 0.4
                            }]
                        },
                        options: {
                            responsive: true,
                            maintainAspectRatio: false,
                            plugins: {
                                legend: { display: true }
                            },
                            scales: {
                                y: { beginAtZero: true }
                            }
                        }
                    });
                }

                // Speed distribution
                if (chartRefs.speed.current) {
                    const speedDistribution = {};
                    filteredData.forEach(row => {
                        Object.entries(row.speeds).forEach(([speedBand, count]) => {
                            speedDistribution[speedBand] = (speedDistribution[speedBand] || 0) + count;
                        });
                    });

                    // Only show speeds with significant data
                    const significantSpeeds = Object.entries(speedDistribution)
                        .filter(([_, count]) => count > 10)
                        .sort((a, b) => {
                            const aMatch = a[0].match(/\d+/);
                            const bMatch = b[0].match(/\d+/);
                            return parseInt(aMatch[0]) - parseInt(bMatch[0]);
                        });

                    charts.current.speed = new Chart(chartRefs.speed.current, {
                        type: 'bar',
                        data: {
                            labels: significantSpeeds.map(([band]) => band.replace('Speed ', '').replace(' to ', '-')),
                            datasets: [{
                                label: 'Vehicle Count by Speed Band',
                                data: significantSpeeds.map(([_, count]) => count),
                                backgroundColor: significantSpeeds.map(([band]) => {
                                    const match = band.match(/\d+/);
                                    const speed = parseInt(match[0]);
                                    return speed <= filters.speedLimit ? 
                                        'rgba(40, 167, 69, 0.8)' : 'rgba(220, 53, 69, 0.8)';
                                }),
                                borderWidth: 2
                            }]
                        },
                        options: {
                            responsive: true,
                            maintainAspectRatio: false,
                            plugins: {
                                legend: { display: false }
                            },
                            scales: {
                                y: { beginAtZero: true }
                            }
                        }
                    });
                }

                // Compliance over time
                if (chartRefs.compliance.current) {
                    const dailyCompliance = {};
                    filteredData.forEach(row => {
                        if (!dailyCompliance[row.date]) {
                            dailyCompliance[row.date] = { total: 0, compliant: 0 };
                        }
                        
                        Object.entries(row.speeds).forEach(([speedBand, count]) => {
                            const match = speedBand.match(/Speed (\d+) to (\d+)/);
                            if (match) {
                                const midSpeed = (parseInt(match[1]) + parseInt(match[2])) / 2;
                                dailyCompliance[row.date].total += count;
                                if (midSpeed <= filters.speedLimit) {
                                    dailyCompliance[row.date].compliant += count;
                                }
                            }
                        });
                    });

                    const complianceRates = Object.entries(dailyCompliance).map(([date, data]) => ({
                        date,
                        rate: (data.compliant / data.total * 100).toFixed(1)
                    }));

                    charts.current.compliance = new Chart(chartRefs.compliance.current, {
                        type: 'line',
                        data: {
                            labels: complianceRates.map(d => d.date),
                            datasets: [{
                                label: 'Compliance Rate (%)',
                                data: complianceRates.map(d => d.rate),
                                borderColor: 'rgba(40, 167, 69, 1)',
                                backgroundColor: 'rgba(40, 167, 69, 0.2)',
                                borderWidth: 3,
                                fill: true,
                                tension: 0.4
                            }]
                        },
                        options: {
                            responsive: true,
                            maintainAspectRatio: false,
                            plugins: {
                                legend: { display: true }
                            },
                            scales: {
                                y: { 
                                    beginAtZero: true,
                                    max: 100
                                }
                            }
                        }
                    });
                }
            };

            const exportData = () => {
                if (!filteredData) return;
                
                const stats = calculateStats();
                let csv = 'Speedwatch Analysis Export\n\n';
                csv += `Date Range:,${stats.dateRange}\n`;
                csv += `Total Vehicles:,${stats.totalVehicles}\n`;
                csv += `Compliance Rate:,${stats.complianceRate}%\n`;
                csv += `Speeding Vehicles:,${stats.speeding}\n\n`;
                csv += 'Timestamp,Total Vehicles,Day of Week,Hour\n';
                
                filteredData.forEach(row => {
                    csv += `${row.timestamp.toISOString()},${row.totalVehicles},${row.dayOfWeek},${row.hour}\n`;
                });

                const blob = new Blob([csv], { type: 'text/csv' });
                const url = window.URL.createObjectURL(blob);
                const a = document.createElement('a');
                a.href = url;
                a.download = 'speedwatch-analysis.csv';
                a.click();
            };

            const stats = calculateStats();

            return (
                <div className="container">
                    <div className="header">
                        <h1>🚗 Speedwatch Data Analysis Dashboard</h1>
                        <p>Interactive traffic monitoring and compliance analysis</p>
                    </div>

                    <div className="content">
                        {loading ? (
                            <div className="loading">
                                <h2>Loading Speedwatch Data...</h2>
                                <p>Please wait while we process your traffic monitoring data</p>
                            </div>
                        ) : !data ? (
                            <div className="loading">
                                <h2>Error Loading Data</h2>
                                <p>Unable to process the Speedwatch data. Please check the console for errors.</p>
                            </div>
                        ) : (
                            <>
                                {stats && (
                                    <div className="stats-grid">
                                        <div className="stat-card">
                                            <div className="stat-label">Total Vehicles</div>
                                            <div className="stat-value">{stats.totalVehicles.toLocaleString()}</div>
                                            <div className="stat-label">{stats.dateRange}</div>
                                        </div>
                                        <div className="stat-card">
                                            <div className="stat-label">Compliance Rate</div>
                                            <div className="stat-value">{stats.complianceRate}%</div>
                                            <div className="stat-label">{stats.compliant.toLocaleString()} compliant</div>
                                        </div>
                                        <div className="stat-card">
                                            <div className="stat-label">Speeding Vehicles</div>
                                            <div className="stat-value">{stats.speeding.toLocaleString()}</div>
                                            <div className="stat-label">{((stats.speeding/stats.totalVehicles)*100).toFixed(1)}% of total</div>
                                        </div>
                                        <div className="stat-card">
                                            <div className="stat-label">Avg per Hour</div>
                                            <div className="stat-value">{stats.avgVehiclesPerHour}</div>
                                            <div className="stat-label">Max: {stats.maxSpeed} mph</div>
                                        </div>
                                    </div>
                                )}

                                <div className="filters">
                                    <h3 style={{marginBottom: '15px'}}>Filters</h3>
                                    <div className="filter-row">
                                        <div className="filter-group">
                                            <label>From Date</label>
                                            <input 
                                                type="date" 
                                                value={filters.dateFrom}
                                                onChange={(e) => setFilters({...filters, dateFrom: e.target.value})}
                                            />
                                        </div>
                                        <div className="filter-group">
                                            <label>To Date</label>
                                            <input 
                                                type="date" 
                                                value={filters.dateTo}
                                                onChange={(e) => setFilters({...filters, dateTo: e.target.value})}
                                            />
                                        </div>
                                        <div className="filter-group">
                                            <label>Day of Week</label>
                                            <select 
                                                value={filters.dayOfWeek}
                                                onChange={(e) => setFilters({...filters, dayOfWeek: e.target.value})}
                                            >
                                                <option value="all">All Days</option>
                                                <option value="Monday">Monday</option>
                                                <option value="Tuesday">Tuesday</option>
                                                <option value="Wednesday">Wednesday</option>
                                                <option value="Thursday">Thursday</option>
                                                <option value="Friday">Friday</option>
                                                <option value="Saturday">Saturday</option>
                                                <option value="Sunday">Sunday</option>
                                            </select>
                                        </div>
                                        <div className="filter-group">
                                            <label>Time of Day</label>
                                            <select 
                                                value={filters.timeOfDay}
                                                onChange={(e) => setFilters({...filters, timeOfDay: e.target.value})}
                                            >
                                                <option value="all">All Times</option>
                                                <option value="morning">Morning (6-12)</option>
                                                <option value="afternoon">Afternoon (12-18)</option>
                                                <option value="evening">Evening (18-24)</option>
                                                <option value="night">Night (0-6)</option>
                                            </select>
                                        </div>
                                        <div className="filter-group">
                                            <label>Speed Limit (mph)</label>
                                            <input 
                                                type="number" 
                                                value={filters.speedLimit}
                                                onChange={(e) => setFilters({...filters, speedLimit: parseInt(e.target.value)})}
                                                min="20"
                                                max="70"
                                                step="5"
                                            />
                                        </div>
                                    </div>
                                    <button className="export-button" onClick={exportData}>
                                        📥 Export Filtered Data
                                    </button>
                                </div>

                                <div className="tabs">
                                    <button 
                                        className={`tab ${activeTab === 'overview' ? 'active' : ''}`}
                                        onClick={() => setActiveTab('overview')}
                                    >
                                        Overview
                                    </button>
                                    <button 
                                        className={`tab ${activeTab === 'hourly' ? 'active' : ''}`}
                                        onClick={() => setActiveTab('hourly')}
                                    >
                                        Hourly Analysis
                                    </button>
                                    <button 
                                        className={`tab ${activeTab === 'daily' ? 'active' : ''}`}
                                        onClick={() => setActiveTab('daily')}
                                    >
                                        Daily Trends
                                    </button>
                                    <button 
                                        className={`tab ${activeTab === 'speed' ? 'active' : ''}`}
                                        onClick={() => setActiveTab('speed')}
                                    >
                                        Speed Distribution
                                    </button>
                                    <button 
                                        className={`tab ${activeTab === 'compliance' ? 'active' : ''}`}
                                        onClick={() => setActiveTab('compliance')}
                                    >
                                        Compliance Tracking
                                    </button>
                                    <button 
                                        className={`tab ${activeTab === 'data' ? 'active' : ''}`}
                                        onClick={() => setActiveTab('data')}
                                    >
                                        Raw Data
                                    </button>
                                </div>

                                {activeTab === 'overview' && (
                                    <div className="chart-section">
                                        <h2>Traffic Overview</h2>
                                        <div className="chart-container">
                                            <canvas ref={chartRefs.daily}></canvas>
                                        </div>
                                    </div>
                                )}

                                {activeTab === 'hourly' && (
                                    <div className="chart-section">
                                        <h2>Hourly Traffic Distribution</h2>
                                        <div className="chart-container">
                                            <canvas ref={chartRefs.hourly}></canvas>
                                        </div>
                                    </div>
                                )}

                                {activeTab === 'daily' && (
                                    <div className="chart-section">
                                        <h2>Daily Traffic Trends</h2>
                                        <div className="chart-container">
                                            <canvas ref={chartRefs.daily}></canvas>
                                        </div>
                                    </div>
                                )}

                                {activeTab === 'speed' && (
                                    <div className="chart-section">
                                        <h2>Speed Distribution Analysis</h2>
                                        <p style={{color: '#666', marginBottom: '15px'}}>
                                            Green bars indicate speeds within limit ({filters.speedLimit} mph), 
                                            red bars indicate speeding
                                        </p>
                                        <div className="chart-container">
                                            <canvas ref={chartRefs.speed}></canvas>
                                        </div>
                                    </div>
                                )}

                                {activeTab === 'compliance' && (
                                    <div className="chart-section">
                                        <h2>Compliance Rate Over Time</h2>
                                        <div className="chart-container">
                                            <canvas ref={chartRefs.compliance}></canvas>
                                        </div>
                                    </div>
                                )}

                                {activeTab === 'data' && filteredData && (
                                    <div className="chart-section">
                                        <h2>Raw Data Table</h2>
                                        <p style={{color: '#666', marginBottom: '15px'}}>
                                            Showing {filteredData.length} records
                                        </p>
                                        <div className="data-table">
                                            <table>
                                                <thead>
                                                    <tr>
                                                        <th>Date</th>
                                                        <th>Time</th>
                                                        <th>Day</th>
                                                        <th>Total Vehicles</th>
                                                    </tr>
                                                </thead>
                                                <tbody>
                                                    {filteredData.slice(0, 100).map((row, idx) => (
                                                        <tr key={idx}>
                                                            <td>{row.date}</td>
                                                            <td>{row.time}</td>
                                                            <td>{row.dayOfWeek}</td>
                                                            <td>{row.totalVehicles}</td>
                                                        </tr>
                                                    ))}
                                                </tbody>
                                            </table>
                                            {filteredData.length > 100 && (
                                                <p style={{textAlign: 'center', padding: '20px', color: '#666'}}>
                                                    Showing first 100 rows of {filteredData.length}
                                                </p>
                                            )}
                                        </div>
                                    </div>
                                )}
                            </>
                        )}
                    </div>
                </div>
            );
        }

        ReactDOM.render(<SpeedwatchDashboard />, document.getElementById('root'));
    </script>
</body>
</html>
